public class Main {
    public static void main(String[] args) {
        String url = "http://10.15.29.180:8003/ws-crypto-2/EdsWebService?wsdl";
        String xmlRequest = "<soapenv:Envelope xmlns:soapenv=\"http://schemas.xmlsoap.org/soap/envelope/\" xmlns:cry=\"http://crypto.ws.ais/\">\n" +
                "   <soapenv:Header/>\n" +
                "   <soapenv:Body>\n" +
                "      <cry:verifySignCades>\n" +
                "         <!--Optional:-->\n" +
                "        <arg0></arg0>\n" +
                "         <arg1></arg1>\n" +
                "           </cry:verifySignCades>\n" +
                "   </soapenv:Body>\n" +
                "</soapenv:Envelope>";

        SoapRequestSender sender = new SoapRequestSender(url);
        long startTime = System.nanoTime();
        String xmlResponse = sender.sendSoapRequest(xmlRequest);
        long endTime = System.nanoTime();
        System.out.println(((endTime - startTime) / 1000000) + " ms " );
        //System.out.println(xmlResponse);
    }
}